import React, { useEffect, useState } from 'react'
import { details2 } from '../../file2'
import Card from 'react-bootstrap/Card'
import Button from 'react-bootstrap/Button'
import './Events.css'
import { useNavigate } from 'react-router-dom'
const Events = () => {
    const [data, setData] = useState(details2)
    const navigate = useNavigate()
    const handleSubmit = () => {

        window.open('https://docs.google.com/forms/d/e/1FAIpQLSfWwYa7gpwvi0Q_WSqnj7S7Zqf4WUfnwjtfIKeDFPMCyEK07g/viewform?usp=sf_link', '_blank');
        // navigate('https://docs.google.com/forms/d/e/1FAIpQLSfWwYa7gpwvi0Q_WSqnj7S7Zqf4WUfnwjtfIKeDFPMCyEK07g/viewform?usp=sf_link', { replace: true })

    }

    return (
        <div className='events'>
            {
                data.map((item, index) => {
                    return (
                        <div className='single-card' key={index}>
                            <Card style={{ width: '18rem' }}>
                                <Card.Img variant="top" src={item.img} />
                                <Card.Body>
                                    <Card.Title>{item.title}</Card.Title>
                                    <Card.Text>
                                        {item.time}
                                    </Card.Text>
                                    <Card.Text><span>Registration Fee :  </span>{item.Fee}</Card.Text>
                                    <Card.Text><span>Student Coordinator :  </span>{item.StudentIncharge}</Card.Text>
                                    <Card.Text>{item.Mentor}<span> </span></Card.Text>
                                    <Button variant="primary" className='btn1' ><a href={item.ppt} alt='error'>View Details</a></Button>
                                    <Button variant="primary" className='btn2' onClick={handleSubmit}>Register</Button>

                                </Card.Body>
                            </Card>
                        </div>
                    )
                })
            }

        </div>
    )
}

export default Events
